&lt;p&gt;
Inch size, fluoropolymer tubing series TIH is available in 4 color variations (translucent, black, red, blue) and 11 size variations. Applicable fittings include high purity fluoropolymer fittings series LQ, and one-touch fittings series KQ2 and KJ. Applicable applications include food, medical care, semiconductor, automobile and general pneumatic piping.
&lt;/p&gt;

